INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (2, null, null, 320, '2019-08-02 13:26:47', '2019-08-02 13:26:47');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20004, 'Looking for these jerseys for next years team. Would like to have our logo included. I''ll have to find a pic.
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20005, 'Our team loves the this orange mock jersey you have made with the Knigts logo, what would the cost be for 20 sets including socks?', null, 348, '2019-08-06 18:05:14', '2019-08-06 18:05:14');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20006, 'We would like the the front to say "Marauders" with the bird and crest from our logo on the left (under the wording. 
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20007, 'We would like the Logo to be on the front and center 
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20008, 'I would like a visual of the logo on the crest of the jersey and also a visual of the logo with the matching socks(on the socks). I need these visuals ASAP as hockey season start soon and we need to make a decision with what we are going with.
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20009, 'Would like to have a tiger/lion claw logo on the sleeve.', 'August 14', 356, '2019-08-14 05:14:29', '2019-08-14 05:14:29');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20010, 'strangerswingslogo (attached) placed on front center of jersey, player name and number on the back for 11 males and 4 females for a softball team. Font used for logo also attached (Benguiat Bold). Looking for jerseys as fast as possible, will be used for company event.', 'As soon as possible', 359, '2019-08-15 04:43:53', '2019-08-15 04:43:53');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20011, 'Artwork: front-center; logo color switching between color 1 and 2 depending on the background. E.g. Cardianal logo when base is Powder, vice versa. 
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20012, 'We would only like the number and names on the back NO NUMBER ON FRONT please 
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20013, 'Centered logo and on the left shoulder if possible. 
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20014, 'Centered logo attached and one on the right arm.
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20015, 'Our team name is Balls Deep and we would just like the writing on the front like most other teams . We do have a sponsor and we would like names on the back. Looking for pricing .', 'Aug 16 2019', 364, '2019-08-16 18:42:00', '2019-08-16 18:42:00');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20016, 'Hi. I’m looking for the 90s style Blues jersey. Custom logo and shoulder patch. Not sure if I want names or not. But numbers for sure. What would be an estimated cost?
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20017, 'Hello,
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20018, 'We would like to purchase 35 track jerseys to use for our cross country, badminton and track and field teams.  As for numbers we aren''t too concerned what they are, the numbers would be more for tracking purposes.   As for sizes I can get that to you once the mock up comes back.  The biggest issue right now is that we have money in our school budget that needs to be spent before August 31st but this also means having the order in our hands (for auditing purposes) by August 31st or we won''t be able to use our current budget for this.  So if it is doable and can be guaranteed that we can have this by august 31st then we would like to go with your company. If you don''t think it will work then I totally understand.', 'August 31st', 368, '2019-08-19 16:06:34', '2019-08-19 16:06:34');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20019, 'We would supply a logo and would like numbers on the back.', 'Aug 28/19', 369, '2019-08-19 17:37:45', '2019-08-19 17:37:45');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20020, 'We are looking for some decent quality Jersey/shorts. We have been the "mustangs" for the last couple years but might be changing our name. I was thinking a purple and black colour scheme similar to the retro Raptors jerseys.', '8/19/2019', 378, '2019-08-19 21:27:15', '2019-08-19 21:27:15');
INSERT INTO jersey_builder.quotes (id, description, date_required, client_id, created_at, updated_at) VALUES (20021, 'Looking for a mockup to see the jerseys. The logo attached should be on the left chest and only a few inches large, and on each sleeve, if possible. Across the back over the shoulders, I''d like to have the player''s name "Acarcion" in white.', null, 379, '2019-08-20 00:23:31', '2019-08-20 00:23:31');
